Invalid configuration of route '${e}': Encountered undefined route.
The reason might be an extra comma.

Example:
const routes: Routes = [
  { path: '', redirectTo: '/dashboard', pathMatch: 'full' },
  { path: 'dashboard',  component: DashboardComponent },, << two commas
  { path: 'detail/:id', component: HeroDetailComponent }
];

formControlName cannot be used with an ngModelGroup parent. It is only compatible with parents
       that also have a "form" prefix: formGroupName, formArrayName, or formGroup.

       Option 1:  Update the parent to be formGroupName (reactive form strategy)

        ${mg.formGroupName}

        Option 2: Use ngModel instead of formControlName (template-driven strategy)

        ${mg.ngModelGroup}

formGroup expects a FormGroup instance. Please pass one in.

       Example:

       ${mg.formControlName}

"
      It looks like you're using the disabled attribute with a reactive form directive. If you set disabled to true
      when you set up this control in your component class, the disabled attribute will actually be set in the DOM for
      you. We recommend using this approach to avoid 'changed after checked' errors.

      Example: 
      form = new FormGroup({
        first: new FormControl({value: 'Nancy', disabled: true}, Validators.required),
        last: new FormControl('Drew', Validators.required)
      });
    "

ngModel cannot be used to register form controls with a parent formGroup directive.  Try using
formGroup's partner directive "formControlName" instead.  Example:

${mg.formControlName}

Or, if you'd like to avoid registering this form control, indicate that it's standalone in ngModelOptions:

Example:

${mg.ngModelWithFormGroup}

ngModel cannot be used to register form controls with a parent formGroupName or formArrayName directive.

Option 1: Use formControlName instead of ngModel (reactive strategy):

${mg.formGroupName}

Option 2:  Update ngModel's parent be ngModelGroup (template-driven strategy):

${mg.ngModelGroup}

ngModelGroup cannot be used with a parent formGroup directive.

Option 1: Use formGroupName instead of ngModelGroup (reactive strategy):

${mg.formGroupName}

Option 2:  Use a regular form tag instead of the formGroup directive (template-driven strategy):

${mg.ngModelGroup}

'.completer-dropdown[_ngcontent-%COMP%] {
        border-color: #ececec;
        border-width: 1px;
        border-style: solid;
        border-radius: 2px;
        width: 250px;
        padding: 6px;
        cursor: pointer;
        z-index: 9999;
        position: absolute;
        margin-top: -6px;
        background-color: #ffffff;
    }

    .completer-row[_ngcontent-%COMP%] {
        padding: 5px;
        color: #000000;
        margin-bottom: 4px;
        clear: both;
        display: inline-block;
        width: 103%;
    }

    .completer-selected-row[_ngcontent-%COMP%] {
        background-color: lightblue;
        color: #ffffff;
    }

    .completer-description[_ngcontent-%COMP%] {
        font-size: 14px;
    }

    .completer-image-default[_ngcontent-%COMP%] {
        width: 16px;
        height: 16px;
        background-image: url("demo/res/img/default.png");
    }

    .completer-image-holder[_ngcontent-%COMP%] {
        float: left;
        width: 10%;
    }
    .completer-item-text-image[_ngcontent-%COMP%] {
        float: right;
        width: 90%;
    }'
